@albhaf That looks like a different problem.
I had a quick look and I think that it's being caused by support being added in the main tensorflow build for reading compressed files. The download dependencies script in the makefile directory is now out of date, along with the Makefile.
A quick work-around should be to remove the two zlib references from your generated tf_cc_files.txt. I haven't checked that yet, but the iOS Camera Demo doesn't use zlib so it might be ok.

